import { useSpring, animated } from '@react-spring/web'

export default function PortfolioCard(){
    const springs = useSpring({
        from: { x: 0 },
        to: { x: 100 },
      })
    return(
        <animated.div 
        style={{ width: 80,
            height: 80,
            background: '#ff6d6d',
            borderRadius: 8,}}>

        </animated.div>
    )
}
